import { Dropvalue } from "./dropcontext"
import styles from "./"

function Dropdisplay(){
    const {drop,clearDropdown}=Dropvalue()
    console.log(drop)
    return(
        <>
            <ul>
                {drop.map((car,i)=>(
                    <li onClick={clearDropdown}  className="cars" key={i}><a>{car}</a></li>
                ))}
            </ul>
        </>
        
    )
}

export default Dropdisplay
